import React, { Component } from "react";

class Date extends Component {
  constructor() {
    super();
    this.state = {
      currentDateTime: Date().toLocaleString(),
    };
  }
  render() {
    return (
      <div>
        <p>{this.state.currentDateTime}</p>
      </div>
    );
  }
}

export default Date;
